CREATE DEFINER=`root`@`localhost` PROCEDURE `hienthisv_lop`(
    IN IdLop VARCHAR(20)
)
BEGIN
    SELECT SINHVIEN.IdSinhVien, SINHVIEN.TenSinhVien, LOP.TenLop, KHOA.TenKhoa, SINHVIEN.NgaySinh, 
    CASE SINHVIEN.GioiTinh WHEN 1 THEN 'Nam' ELSE 'Ná»¯' END AS GioiTinh,
    SINHVIEN.SDT, SINHVIEN.DiaChi
    FROM SINHVIEN
    INNER JOIN LOP ON SINHVIEN.IdLop = LOP.IdLop
    INNER JOIN KHOA ON SINHVIEN.IdKhoa = KHOA.IdKhoa
    WHERE LOP.IdLop = IdLop;
END ;;
