CREATE DEFINER=`root`@`localhost` PROCEDURE `timkiem_sv`(
    IN p_IdSinhVien VARCHAR(20),
    IN p_TenSinhVien VARCHAR(50)
)
BEGIN
    SELECT SINHVIEN.IdSinhVien, SINHVIEN.TenSinhVien, LOP.TenLop, KHOA.TenKhoa, SINHVIEN.NgaySinh, CASE SINHVIEN.GioiTinh WHEN 1 THEN 'Nam' ELSE 'Ná»¯' END AS GioiTinh, SINHVIEN.SDT, SINHVIEN.DiaChi
    FROM SINHVIEN
    INNER JOIN LOP ON SINHVIEN.IdLop = LOP.IdLop
    INNER JOIN KHOA ON SINHVIEN.IdKhoa = KHOA.IdKhoa
    WHERE SINHVIEN.IdSinhVien = p_IdSinhVien OR SINHVIEN.TenSinhVien = p_TenSinhVien;
END ;;
